import React, { useState } from 'react';
import { Link, useHistory } from 'react-router-dom';
import axios from 'axios';

function Home() {
  const [notificationMessage, setNotificationMessage] = useState('');
  const [menuOpen, setMenuOpen] = useState(false);
  const history = useHistory();

  const sendNotification = async () => {
    try {
      await axios.post('http://localhost:8000/api/notifications', { message: notificationMessage });
      console.log('Notification sent');
      setNotificationMessage('');
    } catch (error) {
      console.error('Error sending notification:', error);
    }
  };

  const handleMenuClick = () => {
    setMenuOpen(!menuOpen);
  };

  const handleEditProfileClick = () => {
    history.push('/edit-admin');
  };

  return (
    <div style={{ display: 'flex', minHeight: '100vh', backgroundColor: '#f0f0f0', color: '#000' }}>
      <div style={{ width: menuOpen ? '250px' : '0px', transition: 'width 0.3s', backgroundColor: '#2980b9', color: '#fff', height: '100vh', overflowX: 'hidden', paddingTop: '60px', zIndex: '998' }}>
        <button onClick={handleMenuClick} style={{ position: 'fixed', top: '20px', left: '20px', background: 'none', border: 'none', cursor: 'pointer', zIndex: '999' }}>
          <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round">
            <line x1="3" y1="12" x2="21" y2="12"></line>
            <line x1="3" y1="6" x2="21" y2="6"></line>
            <line x1="3" y1="18" x2="21" y2="18"></line>
          </svg>
        </button>

        <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
          <div style={{ marginTop: '20px', marginBottom: '20px' }}>
            {/* You can fetch adminData from an API or pass it as props */}
            <img src={adminData.picture} alt="Admin" style={{ width: '100px', height: '100px', borderRadius: '50%' }} />
          </div>
          <div style={{ marginBottom: '10px' }}>Welcome back, {adminData.name}</div>
          <button onClick={handleEditProfileClick} style={{ padding: '8px 16px', cursor: 'pointer', backgroundColor: '#2980b9', color: '#fff', border: 'none', borderRadius: '5px', marginBottom: '20px' }}>Edit Profile</button>
        </div>

        <Link to="/" style={{ display: 'block', padding: '20px', textDecoration: 'none', color: '#fff' }}>Home</Link>
        <Link to="/notifications" style={{ display: 'block', padding: '20px', textDecoration: 'none', color: '#fff' }}>Notifications</Link>
        <Link to="/settings" style={{ display: 'block', padding: '20px', textDecoration: 'none', color: '#fff' }}>Settings</Link>
      </div>

      <div style={{ flex: '1', padding: '20px', marginLeft: menuOpen ? '250px' : '0px', transition: 'margin-left 0.3s', backgroundColor: '#f0f0f0', color: '#000' }}>
        <h1 style={{ marginBottom: '20px', color: '#2980b9' }}>Society Connect <br></br> Admin Dashboard</h1>

        <div style={{ backgroundColor: '#fff', color: '#000', padding: '20px', borderRadius: '10px', boxShadow: '0 4px 8px rgba(0, 0, 0, 0.1)', marginBottom: '20px' }}>
          <h2 style={{ color: '#2980b9', marginBottom: '20px' }}>Generate Notification</h2>
          <textarea
            value={notificationMessage}
            onChange={(e) => setNotificationMessage(e.target.value)}
            placeholder="Enter notification message..."
            style={{ width: '100%', minHeight: '100px', marginBottom: '10px', padding: '8px', borderRadius: '5px', border: '1px solid #ccc' }}
          />
          <button onClick={sendNotification} style={{ padding: '8px 16px', cursor: 'pointer', backgroundColor: '#2980b9', color: '#fff', border: 'none', borderRadius: '5px' }}>Send Notification</button>
        </div>

        <br />
        <Link to="/" style={{ color: '#2980b9' }}>Logout</Link>
      </div>
    </div>
  );
}

export default Home;
